export class AttendeesService {
    constructor() {
        this.attendees = [];
    }

    async loadAttendees() {
        this.attendees = await csvtojson({
            noheader:true,
            output: "csv"
        }).fromString(stringAttendees);

        this.attendees = this.attendees.map((a, index) => {
            a = a.map((col, index) => {
                if (index === 0) return col;
                if (col === '') return [];
                return col.split(' ');
            });
            return a;
        })
    }
}